css:
/* AGENT_SHEET */
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("wikipedia.org") {

/*seriously, that banner is fucking annoying*/
#siteNotice{display:none!important;}

/**********/
/*Defaults*/
/**********/
body{background:transparent!important;}
.body,html{background-color:#050505!important;color:#fff!important;border-color:#555!important;}
h1,h2,h3,h4{color:#aff!important;}
a{color:#9df!important;}
#footer,#footer li{background-color:#000!important;color:#aaa!important;}
table,td,tr,th{background:transparent!important;color:#fff!important;border-color:#555!important;}

input *,textarea *{background:#000!important;color:#fff!important;border-color:#555!important;}

code{background:#111!important;color:#fd9!important;}

/****************************/
/*Top of the page navigation*/
/****************************/
#head{background:#050505!important;}

/*FUCK YOU WIKI EDITORS*/
#mw-head{background:#000!important;}

/*****************************************************/
/*This section changes the front page left side menus*/
/*****************************************************/
[class="portal expanded"],[class="portal collapsed"],.portal li{background-color:#050505!important;}
#panel div.portal
{
		margin: 0!important;
		padding-top: 0.5em!important;
		margin-left: 1.25em!important;
background-image:url("data:image/png;base64,") !important;
		background-repeat: no-repeat!important;
		background-position: top left!important;
}

/*This changes the left side menu tabs*/
#panel h5
{
color:#fff!important;
}

/*********************************************************/
/*Main Page content area, the biggest part of your screen*/
/*********************************************************/
#mp-topbanner table div{color:#fff!important;}
#mp-topbanner{background:#111!important;border-color:#222!important;}

#content,#head-base,#footer,#page-base
{
color:#fff!important;
background-image: url("data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABAQMAAAAl21bKAAAAAXNSR0IArs4c6QAAAANQTFRFACgxq/mTSgAAAAFiS0dEAIgFHUgAAAAJcEhZcwAACxMAAAsTAQCanBgAAAAHdElNRQfaBRcMMg3ghKQXAAAACklEQVQI12NgAAAAAgAB4iG8MwAAAABJRU5ErkJggg==") !important;
background-color:#000!important;}

/*This is the 1px perimeter box around the main page articles*/
.MainPageBG{border-color:#555!important;background-color:#000!important;}

/*Banners: Today's Featured Article, and the one underneath it (left side)*/
#mp-left{background-color:#010!important;}
#mp-left td,#mp-left th{background:#010!important;border:none!important;}
#mp-tfa-h2,#mp-dyk-h2
{
background:#020!important;color:#fff!important;border-color:#030!important;
}

/*The right part: In the news, On this day, blah blah*/
#mp-right{background-color:#001!important;}
#mp-right td,#mp-right th{background:#001!important;border:none!important;}
#mp-itn-h2,#mp-otd-h2
{
background:#003!important;color:#fff!important;border-color:#005!important;
}

/*Today's featured pornographic*/
#mp-tfp tr td,.MainPageBG table{background:#101!important;}
#mp-tfp th{background:#101!important;border:none!important;}
#mp-tfp-h2,#mp-tfp-h2
{
background:#202!important;color:#fff!important;border-color:#505!important;
}

/*Catlinks*/
.catlinks{background-color:#011!important;border-color:#055!important;}

/*Search*/
#simpleSearch,#searchForm{background:#011!important;border-color:#055!important;}

/***********************/
/*Article Stuff, mostly*/
/***********************/
/*Images need white backgrounds...sigh*/
img{background:#fff!important;}

#mw-js-message{background-color:#011!important;border-color:#055!important;}

/*standard headings*/
h2{background:#011!important;border-color:#055!important;}
h1{border-color:#055!important;}

/*infobox*/
.infobox,.infobox td{background:#011!important;border-color:#055!important;color:#fff!important;}

/*thumbs*/
.thumbinner,.thumbimage,[class="thumb tleft"],[class="thumb tright"],[class="thumb tnone"]
{background:#022!important;border-color:#055!important;}
.thumbcaption
{background-color:#033!important;text-align:center!important;}

/*navbox*/
.navbox{border-color:#055!important;}

/*searchbox*/
#simpleSearch{border-color:#055!important;}

/*TOCs and plainlinks*/
.plainlinks,#toc{background:#000!important;border-color:#555!important;}

/********/
/*EDITOR*/
/********/
.wikiEditor-ui-toolbar,.wikiEditor-ui-controls{background:#011!important;border-color:#055!important;}
.wikiEditor-ui,.wikiEditor-ui-text,.wikiEditor-ui-top{border-color:#055!important;}

/*dropdowns*/
.index{background:#011!important;}
.index div{color:#9df!important;}
.pages{background:#000!important;}
.cell-description,.booklet{border-color:#055!important;}
td.cell-syntax,td.cell-result{color:#9fd!important;border-color:#055!important;}

/*******/
/*Prefs*/
/*******/
.jsprefs{background:#050505!important;border-color:#022!important;}
fieldset,legend{border-color:#022!important;color:#9df!important;}
/*****************/
/* inline images */
/*****************/
/*current tab at the top*/
/*this makes the text readable with the following images*/
.vectorTabs span{color:#9df!important;}

/*this is the 1px-wide separators between all tabs*/
div.vectorTabs,div.vectorTabs li:not(.icon) a,div.vectorTabs ul,#head div.vectorMenu h5,div.vectorMenu h5 a,
#preftoc,#preftoc li{
		background-image: url("data:image/png;base64,") !important;
}

/*these are the non-selected tabs*/
div.vectorTabs ul li:not(.selected)
{
	background-image: url("data:image/png;base64,") !important;
}

/*this is the current tab*/
div.vectorTabs li.selected,
#preftoc li.selected a {
		background-image:url("data:image/png;base64,") !important;
}

/*star icons*/
#ca-unwatch.icon a,#ca-watch.icon a
{
background-image:url("data:image/png;base64,") !important;
}

#ca-watch.icon a.loading,#ca-unwatch.icon a.loading

{
background-image:url("data:image/png;base64,") !important;
}

a[title="Visit the main page"]
{
	background-image: url("data:image/png;base64,") !important;
background-color:#050505!important;
}

}
